import React from 'react';
import {Link} from 'react-router-dom';

function NavbarComponent(){
    return(
        <nav>
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/saved'>Saved Weather Points</Link></li>
        </nav>
    )
}
export default NavbarComponent;
